import { ListItem } from "@material-ui/core";
import { useEffect, useState } from "react";
import PortfolioList from '../portfolioList/PortfolioList'
import'./portfolio.scss'
import {
    featuredPortfolio,
    webPortfolio,
    mobilePortfolio,
    designPortfolio,
    contentPortfolio,
  } from "../../data"

export default function Portfolio() {
    const [selected, setselected] = useState("featured")
    const [data, setData] = useState([])

    const list = [
        {
          id: "featured",
          title: "Featured",
        },
        {
          id: "web",
          title: "Web App",
        },
        {
          id: "mobile",
          title: "Mobile App",
        },
        {
          id: "design",
          title: "Design",
        },
        {
          id: "content",
          title: "Content",
        },
      ];

      useEffect(()=>{
        switch(selected){
            case "featured":
                setData(featuredPortfolio);
                break;

            case "featured":
                setData(featuredPortfolio);
                break;

            case "featured":
                setData(featuredPortfolio);
                break;

            case "featured":
                setData(featuredPortfolio);
                break;

                    
            case "featured":
                setData(featuredPortfolio);
                break;

                        
            case "featured":
                setData(featuredPortfolio);
                break;


        }
      }),[selected]

    return (
        <div className='portfolio' id= "portfolio">
            <h1>Portfolio</h1>
            <ul>
            {list.map((item) => (
            <PortfolioList title={item.title} 
            id = {item.id}
            active = {selected === item.id} 
            setselected = {setselected} />
        ))}
            </ul>
            
            <div className="container">

                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>
                
                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>
                
                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>
                
                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>
                
                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>
                
                <div className="item">
                    <img src="https://static.wixstatic.com/media/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.jpeg/v1/fill/w_598,h_345,al_c,q_80,usm_0.66_1.00_0.01/982f08_9b1d5d4339654a28821e1bc461981521~mv2_d_4288_2848_s_4_2.webp" alt="" />
                    <h3> Bubble Tea App </h3>
                </div>

            </div>

        </div>
    )
